import {SIGNED_OUT,SIGNED_IN} from '../actions/types';

const initialState = {
    auth: false
}

// eslint-disable-next-line import/no-anonymous-default-export
export default function (state=initialState , action) {
    console.log(action);
    switch (action.type) {
        case SIGNED_IN:
            return {
                ...state,
                auth: !state.auth,
            }
    
        default:
            break;
    }
}
